script: |
  super -f text -I q9812.spq | sort > q9812.out

inputs:
  - name: q9812.spq
    data: |
      SELECT DISTINCT - col1 * col2 + cor0.col1 + col2 * - col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q9812.out
    data: |
      -1535
      -2073
      -2151
